import React from "react";

function Home() {
  return (
    <div style={{ margin: "0 auto", width: "80%" , marginTop: 4}}>
      <img
        src="https://images.unsplash.com/photo-1556075798-4825dfaaf498?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=400&q=60"
        alt="home page"
      />
    </div>
  );
}

export default Home;
